import static org.junit.Assert.*;
import org.junit.Test;

public class GameTest {

	@Test
	public void testConstructor() {
		Game game = new Game();
		assertNotNull(game);
		assertEquals(game.players,2);
	}
	
	@Test
	public void testConstructorOfInt(){
		for(int i=2;i<6;i++){
			Game game = new Game(i);
			assertEquals(game.players,i);
		}
		Game game =new Game(1);
		assertEquals(2,game.players);
		
		Game game1 =new Game(6);
		assertEquals(2,game1.players);
	}
	
}

public class Game {
	
	public int players;
	
	//Default Game is two players
	public Game(){
		players=2;
	}
	
	//Sets players 1-6, else default
	public Game(int playerNumber) {
		if(playerNumber>1 && playerNumber<6){
			players=playerNumber;
		}else{
			players=2;
		}
	}
}

import static org.junit.Assert.*;

import org.junit.Test;

public class DeckTest {	
	
	@Test
	public void testInit() {
		Deck main = new Deck();
		assertNotNull(main);
		
		assertEquals(main.getSize(), 5);
	}

	@Test
	public void testShuffle() {
		Deck test = new Deck();
		test.shuffle();
		
		boolean inOrder = true;
		
		for(int i = 0; i < test.getSize(); i++) {
			if(test.getCard(i).getID() > test.getCard(i+1).getID()) {
				inOrder = false;
				break;
			}
		}
		
		assertFalse(inOrder);
	}
	
	@Test
	public void testShuffleReverse() {
		Deck test = new Deck();
		test.shuffle();
		
		boolean inOrder = true;
		
		for(int i = 0; i < test.getSize(); i++) {
			if(test.getCard(i).getID() < test.getCard(i+1).getID()) {
				inOrder = false;
				break;
			}
		}
		
		assertFalse(inOrder);
	}
	
	@Test
	public void testThatDrawRemovesOneCard() {
		Deck test = new Deck();
		int cursize = test.getSize();
		int expsize = cursize - 1;
		
		test.draw();
		
		cursize = test.getSize();
		assertEquals(expsize, cursize);

	}
	@Test
	public void testMakeTrainDeck(){
		final int CARD_COUNT=12;
		final int WILD_CARD_COUNT=14;
		
		Deck deck = new Deck();
		assertEquals(110,deck.getSize());
		int i=0;
		for (TrainCard.CARD_TYPE type : TrainCard.CARD_TYPE.values()){
			int cards;
			if(type==TrainCard.CARD_TYPE.WILD){
				cards=WILD_CARD_COUNT;
			}else{
				cards=CARD_COUNT;
			}
			for(;i<cards;i++){
				assertEquals(type,((TrainCard)deck.getCard(i)).cardType);
			}
		}
	}
}

import java.util.ArrayList;
import java.util.Collections;


public class Deck {
	
	ArrayList<ICard> deck;
	
	public Deck() {
		this.deck = new ArrayList<ICard>();
		this.init();
	}

	private void init() {
		ICard testcard1 = new TestCard(1);
		ICard testcard2 = new TestCard(2);
		ICard testcard3 = new TestCard(3);
		ICard testcard4 = new TestCard(4);
		ICard testcard5 = new TestCard(5);
		
		this.deck.add(testcard1);
		this.deck.add(testcard2);
		this.deck.add(testcard3);
		this.deck.add(testcard4);
		this.deck.add(testcard5);
	}

	public void shuffle() {
		Collections.shuffle(this.deck);
	}

	public int getSize() {
		return this.deck.size();
	}

	public ICard getCard(int i) {
		return this.deck.get(i);
	}

	public ICard draw() {
		return this.deck.remove(0);
	}
}
